import React from 'react';
import '../style/footer.css';
import Logo from '../assets/logo.svg'
import PhotoFacebook from '../assets/icon-facebook.svg';
import PhotoInsta from '../assets/icon-instagram.svg';
import PhotoTwiiter from '../assets/icon-twitter.svg';
import PhotoPinterest from '../assets/icon-pinterest.svg';

const Footer = () => {
  return (
      <footer className="footer">
          <div className="footer-logo">
              <img src={Logo} alt="logo"/>
          </div>
          <div className="footer-links">
              <div className="footer-about">About</div>
              <div className="footer-services">Services</div>
              <div className="footer-projects">Projects</div>
          </div>
          <div className="footer-icons">
              a
              <img src={PhotoFacebook} alt="facebook" className="icons-facebook" />
              <img src={PhotoInsta} alt="instagram" className="icons-instagram" />
              <img src={PhotoTwiiter} alt="twitter" className="icons-twitter" />
              <img src={PhotoPinterest} alt="printerests" className="icons-printerests" />
          </div>
      </footer>
  );
};

export default Footer;
